import React, { Component } from "react";

import { BrowserRouter as Route, Link } from "react-router-dom";

import Control_Risk from "./control_risk_list.component";

class Home extends Component {

	render() {

		return(

			<div className = 'container'>

				<div>

					<button type="button" class="btn btn-primary btn-lg">

						Administrador de matriz de riesgo

					</button>

				</div>

				<div>

					<Link to={"${mathc.url}/control_risk_consult/"} className="nav-link">

	                    Trabajador

                  	</Link>

				</div>

				<Route path = {'${match.path}/control_risk_consult/'} exact component = {Control_Risk} />

			</div>

		);

	}

}

export default Home;
